format ELF64 executable 3                 ;; ELF64 Format for GNU+Linux
segment readable executable               ;; Executable code section

sys_close   equ 3
sys_write   equ 1
sys_socket  equ 41
sys_bind    equ 49
sys_listen  equ 50
sys_accept  equ 43
sys_send    equ 44
sys_exit    equ 60
AF_INET     equ 2
PF_INET     equ 2
SOCK_STREAM equ 1
IPPROTO_IP  equ 0

stdout      equ 1

SYS_RECV    equ 45


_start:

;;;;;;;;;;;;    socket  ;;;;;;;;;;;;;;;;;;

    ; socket(AF_INET, SOCK_STREAM, 0)
    mov rax, sys_socket
    mov rdi, AF_INET   ;AF_INET
    mov rsi, SOCK_STREAM
    mov rdx, IPPROTO_IP   ; default protocol
    syscall
    mov R12, rax  ; сохраняем дескриптор сокета

    ; выход на ошибку
    cmp rax, 0
    jl exit_error

    ; вывод в консоль "socket_ok"                                    
    mov rax, sys_write                    
    mov rdi, stdout                       
    mov rsi, socket_ok                  
    mov rdx, socket_ok_length           
    syscall
;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;

;;;;;;;;;;;;    bind  ;;;;;;;;;;;;;;;;;;
    ; bind(sockfd, &addr, sizeof(addr))
    mov rsi, my_addr
    mov rdx, my_addr_length
    mov rdi, R12
    mov rax, sys_bind
    syscall

    ; выход на ошибку
    cmp rax, 0
    jl exit_error

    ; вывод в консоль "bind_ok"                                    
    mov rax, sys_write                    
    mov rdi, stdout                       
    mov rsi, bind_ok                  
    mov rdx, bind_ok_length           
    syscall
;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;

;;;;;;;;;;;;    listen  ;;;;;;;;;;;;;;;;;;
    ; listen(sockfd, 5)
    mov rax, sys_listen
    mov rsi, 20       ; backlog
    mov rdi, R12
    syscall

    ; выход на ошибку
    cmp rax, 0
    jl exit_error
    ; вывод в консоль "listen_ok"                                    
    mov rax, sys_write                    
    mov rdi, stdout                       
    mov rsi, listen_ok                  
    mov rdx, listen_ok_length           
    syscall
;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;


accept_loop:
;;;;;;;;;;;;    accept  ;;;;;;;;;;;;;;;;;;
    ; accept(sockfd, NULL, NULL)
    mov rax, sys_accept
    mov rdi, R12
    xor rsi, rsi
    xor rdx, rdx
    syscall

    mov rdi, rax  ; сохраняем дескриптор клиента
    mov r10, rdi 

    ; выход на ошибку
    cmp rax, 0
    jl exit_error

    ; вывод в консоль "accept_ok"                                    
    mov rax, sys_write                    
    mov rdi, stdout                       
    mov rsi, accept_ok                  
    mov rdx, accept_ok_length           
    syscall
;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;

    ; Читаем запрос
    mov rax, 0 ; sys_read
    mov rdi, r10
    mov rsi, buffer
    mov rdx, 1024
    syscall
    ; вывод в консоль   buffer                                  
    mov rax, sys_write                    
    mov rdi, stdout                       
    mov rsi, buffer                  
    mov rdx, buffer_length           
    syscall

    ; ветвление на GET и POST
    cmp byte [buffer], 'G'
    je get    ; прыжок на GET запрос 
    ;cmp byte [buffer], 'P'
    ;je post         ; прыжок на POST запрос 

    ; вывод в консоль  hello                                  
    mov rax, sys_write                    
    mov rdi, stdout                       
    mov rsi, hello                  
    mov rdx, hello_length           
    syscall

    jmp close

post:
    ; вывод в консоль  post_msg                                  


    jmp close


post_qwe:
    ; вывод в консоль  post_msg                                  
    mov rax, sys_write                    
    mov rdi, stdout                       
    mov rsi, post_qwe_msg                  
    mov rdx, post_qwe_msg_length           
    syscall

    mov R8, htmx_qwe
    mov R9, htmx_qwe_length
    jmp write_loop

    jmp close

post_asd:
    ; вывод в консоль  post_msg                                  
    mov rax, sys_write                    
    mov rdi, stdout                       
    mov rsi, post_asd_msg                  
    mov rdx, post_asd_msg_length           
    syscall

    mov R8, htmx_asd
    mov R9, htmx_asd_length
    jmp write_loop

    jmp close

post_zxc:
    ; вывод в консоль  post_msg                                  
    mov rax, sys_write                    
    mov rdi, stdout                       
    mov rsi, post_zxc_msg                  
    mov rdx, post_zxc_msg_length           
    syscall

    mov R8, htmx_zxc
    mov R9, htmx_zxc_length
    jmp write_loop


    jmp close


get:
    cmp byte [buffer+5], 'q'
    je post_qwe         ; прыжок на  /qwe запрос 

    cmp byte [buffer+5], 'a'
    je post_asd         ; прыжок на  /asd запрос

    cmp byte [buffer+5], 'z'
    je post_zxc         ; прыжок на  /zxc запрос




    mov R8, html_response
    mov R9, response_length
    jmp write_loop



write_loop:

    ; write(client_fd, html_response, length)
    mov rax, sys_write
    mov rsi, R8
    mov rdi, r10
    mov rdx, R9
    syscall

    sub R9, rax                 ; subtract the number of bytes written
    add R8, rax                    ; move the pointer forward

    cmp R9, 0             ; check if there are more bytes left to write
    jg write_loop            ; if yes, loop back
close:
    ; close(client_fd)
    mov rax, sys_close
    mov rdi, r10   ; восстанавливаем дескриптор клиента из r10
    syscall
    jmp accept_loop

exit:
    ;; выход из программы 
    mov eax, 60                     
    mov edi, 0               
    syscall 

exit_error:
    ; вывод в консоль '!! error_msg !!'                             
    mov rax, sys_write                    
    mov rdi, stdout                       
    mov rsi, error_msg                  
    mov rdx, error_msg_length           
    syscall
    ;; выход из программы ошибка
    mov eax, 60                     
    mov edi, 1                 
    syscall 


